import tkinter as tk
from tkinter import filedialog, messagebox
from PIL import Image
import io
import zipfile
import base64
import ctypes
import os

# Base64-encoded icon data
icon_data_base64 = """
   
"""

# Helper function to set window icon using base64 data
def set_window_icon_from_base64(window, icon_base64):
    try:
        # Decode base64 icon data
        icon_data = base64.b64decode(icon_base64)

        # Save decoded icon data to a temporary file
        temp_icon_path = "temp_icon.ico"
        with open(temp_icon_path, "wb") as f:
            f.write(icon_data)

        # Set window icon using ctypes
        window.iconbitmap(temp_icon_path)

        # Remove temporary icon file
        os.remove(temp_icon_path)

    except Exception as e:
        messagebox.showwarning("Warning", f"Failed to set window icon: {e}")

def select_file():
    file_path = filedialog.askopenfilename(
        filetypes=[("PNG files", "*.png")],
        title="Select a PNG file"
    )
    if file_path:
        file_path_var.set(file_path)

def run():
    file_path = file_path_var.get()
    if not file_path:
        messagebox.showerror("Error", "Please select a PNG file.")
        return

    try:
        img = Image.open(file_path)
        img.thumbnail((128, 128), Image.LANCZOS)

        zip_buffer = io.BytesIO()
        with zipfile.ZipFile(zip_buffer, 'a', zipfile.ZIP_DEFLATED) as zf:
            for i in range(1, 47):
                img_io = io.BytesIO()
                img.save(img_io, format='PNG')
                img_io.seek(0)
                zf.writestr(f'shime{i}.png', img_io.read())

        zip_buffer.seek(0)
        with open("shimeji.zip", "wb") as f:
            f.write(zip_buffer.read())

        messagebox.showinfo("Success", "shimeji.zip created successfully!")
    except Exception as e:
        messagebox.showerror("Error", f"An error occurred: {e}")

app = tk.Tk()
app.title("Cauli's Shimeji-ee Generator")
app.geometry("400x200")

# Set window icon using base64-encoded data
set_window_icon_from_base64(app, icon_data_base64)

file_path_var = tk.StringVar()

tk.Label(app, text="Select a PNG file:").pack(pady=10)
tk.Entry(app, textvariable=file_path_var, width=50).pack(pady=5)
tk.Button(app, text="Browse", command=select_file).pack(pady=5)
tk.Button(app, text="Run", command=run).pack(pady=20)

app.mainloop()
